package app;import app.infrastructure.sequence.RedisSequenceClient;import app.infrastructure.sequence.SequenceClient;import com.google.inject.AbstractModule;import com.google.inject.Provides;import com.google.inject.Singleton;import com.google.inject.name.Named;import redis.clients.jedis.JedisPooled;public class AppModule extends AbstractModule {    @Singleton    @Provides    @Named("sequence-client")    protected SequenceClient bindSequenceClient() {        JedisPooled jedisPooled = new JedisPooled("localhost", 6379);        return new RedisSequenceClient(jedisPooled);    }}